import React from "react";
import "./App.css";
import HomePage from "./pages/HomePage";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <Router>
        <Routes>
          <Route path="/search">
            <h1>search</h1>
          </Route>
          <Route path="/"  element={<HomePage/>}>
            <HomePage />
          </Route>
        </Routes>
      </Router>
      {/* <HomePage /> */}
    </div>
  );
}

export default App;
